import React from 'react';
import Logo from '../assets/logo.png';
import '../styles/card.css' 

const Card = () => {
  return (
    <div className="logoCard">
        <img src={Logo} alt="logo" />

      <p className='text-white'>Login to <br /> <span className='fw-bold'>tria</span> Demo</p>

    </div>
  );
}

export default Card;
